function Authreducer(state={

    laptops:10,
    mobiles:20


}, action){

    switch(action,type) {
        case "LOGIN": {
            state["token"] = action.payload?.token
            alert(state.token)
            return state
        }

        default: return state
    }
}

export default Authreducer
